" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 601px\">",
"   <div class=\"ttl\">",
"    Hymenolepiasis diminuta eggs",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 581px; height: 293px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A, B) Eggs of",
"    <em>",
"     Hymenolepis diminuta",
"    </em>",
"    . These eggs are round or slightly oval, size 70 to 85 micrometers by 60 to 80 micrometers, with a striated outer membrane and a thin inner membrane. The space between the membranes is smooth or faintly granular. The oncosphere has six hooks. There are no polar filaments extending into the space between the oncosphere and the outer shell.",
