var title_f42_59_43963="RX crypto mening transplant";
var content_f42_59_43963=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F56336&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F56336&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antifungal treatment recommendations for cryptococcal meningoencephalitis in transplant recipients",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Regimen",
"       </td>",
"       <td class=\"subtitle1\">",
"        Duration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Induction therapy*",
"       </td>",
"       <td>",
"        Liposomal AmB (3-4 mg/kg per day) OR ABLC (5 mg/kg per day) PLUS flucytosine (100 mg/kg per day)",
"       </td>",
"       <td>",
"        2 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Alternatives for induction therapy",
"       </td>",
"       <td>",
"        Liposomal AmB (6 mg/kg per day) OR ABLC (5 mg/kg per day)",
"       </td>",
"       <td>",
"        4-6 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        AmBd (0.7 mg/kg per day)&bull;",
"       </td>",
"       <td>",
"        4-6 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consolidation therapy",
"       </td>",
"       <td>",
"        Fluconazole (400-800 mg per day)",
"       </td>",
"       <td>",
"        8 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maintenance therapy",
"       </td>",
"       <td>",
"        Fluconazole (200-400 mg per day)",
"       </td>",
"       <td>",
"        6 months to 1 year",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ABLC: amphotericin B lipid complex; AmB: amphotericin B; AmBd: amphotericin B deoxycholate.",
"     <br>",
"      * Immunosuppressive management may require sequential or step-wise reductions.",
"      <br>",
"       &bull; Many transplant recipients have been successfully treated with AmBd; however, issues of renal dysfunction with calcineurin inhibitors are important and the effective dose is imprecise.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Perfect, JR, Disnukes, WE, Dromer, F, et al. Clinical practice guidelines for the management of cryptococcal disease: 2010 update by the Infectious Diseases Society of America. Clin Infect Dis 2010; 50:291. Copyright &copy; 2010 University of Chicago Press.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.journals.uchicago.edu/\">",
"      file://www.journals.uchicago.edu/",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
