var title_f42_59_43967="Effect of dynamic extrathoracic airway obstruction";
var content_f42_59_43967=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F65386%7EPULM%2F55931&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F65386%7EPULM%2F55931&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Effect of dynamic extrathoracic airway obstruction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 327px; height: 272px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effects of forced expiration and inspiration in dynamic extrathoracic airway obstruction. Left panel, during forced expiration, intratracheal pressure (P",
"    <sub>",
"     tr",
"    </sub>",
"    ) exceeds the pressure around the airway (P",
"    <sub>",
"     atm",
"    </sub>",
"    ), lessening the obstruction. Right panel, during forced inspiration, when P",
"    <sub>",
"     tr",
"    </sub>",
"    falls below P",
"    <sub>",
"     atm",
"    </sub>",
"    , the obstruction worsens resulting in flow limitation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Kryger M, Bode F, Antic R, et al. Am J Med 1976; 61:85.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Effects of dynamic intrathoracic airway obstruction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 327px; height: 266px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Left panel, during forced expiration, the intrathoracic intratracheal pressure (P",
"    <sub>",
"     tr",
"    </sub>",
"    ) is less than the pleural pressure (P",
"    <sub>",
"     pl",
"    </sub>",
"    ), worsening the obstruction. Right panel, during forced inspiration, P",
"    <sub>",
"     tr",
"    </sub>",
"    exceeds P",
"    <sub>",
"     pl",
"    </sub>",
"    , lessening the degree of obstruction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Kryger M, Bode F, Antic R, et al. Am J Med 1976; 61:85.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
